import React, { useContext } from 'react';

import {FirstName} from './App';


const ComB = () => {
  const fname = useContext(FirstName);
  return(
    <>
    <FirstName.Consumer>
      {(fname)=>{
        return <h1> My name is {fname} </h1>
      }}
    </FirstName.Consumer>
     
    </>
  );
};

export default ComB;
